import React, {useState, useMemo, useEffect} from "react";
import About from "./pages/About";
import {
  BrowserRouter,
  Route,
  Routes,
} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <Routes>
        <Route element={<About/>} path="/about" />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
